description:
Аккумуляторная-сетевая машинка для стрижки волос Andis Cordless Uspro Li Fade 73060 - профессиональная машинка от Andis, предназначенная для окантовочных техник, для создания фейдов и тейперинга.

 

Машинка для стрижки с комбинированным питанием Andis Cordless Uspro Li Fade 73060  преимущества и особенности:

Очень мощный роторный мотор - 6000 об/мин;
Ударопрочный эргономичный корпус;
Комбинированное питание - от литий ионного аккумлятора и от сети;
Время автономной работы - до 120 мин;
Полная зарядка аккумулятора занимает 90 мин;
Премиальный нож из нержавеющей углеродной стали;
Регулируемая высота среза – от 0.2 - 0.5 мм;
Ширина ножевого блока - 46 мм;
Пластиковая петля для подвешивания;
Вес – 280 гр;
Размер - 170 x 40 x 55 мм.

 

Профессиональная машинка для стрижки волос Andis Cordless Uspro Li Fade 73060 комплектация:

5 насадок - 0 (1/16") 1.5 мм, 1/2 (3/32") 2.25 мм, 1 (1/8") 3 мм, 1-1/2 (3/16") 4.5 мм, 2 (1/4") 6 мм;
защитный колпачок для ножа;
зарядное устройство;
смазочное масло;
щеточка для чистки.

Сделано в США. 

